(3001, 'Число случаев заражения коронавирусом в США превысило 16 млн', 'В США выявили уже 16 020 646 случаев заражения коронавирусом с начала пандемии, следует из данных Университета Джонса Хопкинса. За это время в стране умерли от COVID-19 297 575 человек. Больше всего зараженных и смертей от коронавирусной инфекции зафиксировано в Лос-Анджелесе — 501 635 и 8199 соответственно. Соединенные Штаты по-прежнему лидируют по числу выявленных случаев заболевания COVID-19 и летальных исходов. По числу заболевших второе место занимает Индия, на третьем - Бразилия, по числу смертей — наоборот, после США идет Бразилия, а затем Индия. Россия по числу случаев заражения коронавирусом находится на четвертом месте. 11 декабря в США выявили рекордное число зараженных за сутки — более 231,7 тыс. Управление по вопросам качества продовольствия и медикаментов США (FDA) 12 декабря разрешило применение вакцины против коронавирусной инфекции, разработанной американской Pfizer и немецкой BioNTech. Она стала первой вакциной, разрешенной в стране. Президент Дональд Трамп объявил о начале вакцинации американцев против COVID-19. Он пообещал ввести первую вакцину «менее чем через 24 часа». ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/500x312_crop/media/img/5/10/756078107744105.jpg', 'https://www.rbc.ru/rbcfreenews/5fd54e099a794727a559fc85?from=newsfeed'),
(3002, 'В Чечне произошло землетрясение магнитудой 4,9', 'В Чеченской Республике произошло землетрясение магнитудой 4,9, сообщается на сайте Северо-Осетинского филиала Единой геофизической службы РАН. Очаг находился на глубине 25 км. По данным Европейско-Средиземноморского сейсмологического центра, подземные толчки были зафиксированы в 00:29 13 декабря в 82 км от Владикавказа и 14 км севернее Грозного. Магнитуда составила 4,7, очаг находился на глубине 10 км. 10 декабря произошло землетрясение в Бурятии. Эпицентр находился в Кабанском районе, там сила толчков составила 7,6 балла. В Иркутске ощущались толчки силой 5–6 баллов. В городе ввели режим повышенной готовности. Землетрясение почувствовали и жители Улан-Удэ. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/500x312_crop/media/img/6/93/756075603621936.jpg', 'https://www.rbc.ru/rbcfreenews/5fd5460a9a794727d84ed456?from=newsfeed');
INSERT INTO `news` (`id`, `title`, `content`, `status`, `picture`, `url`) VALUES
(3003, 'Футбольный «Спартак» обвинил тренера «Сочи» в национализме', 'Московский футбольный «Спартак» обвинил тренера вратарей «Сочи» Дмитрия Бородин в национализме после матча чемпионата России (0:1). Текст заявления клуба опубликован на официальном сайте красно-белых. «В перерыве матча 18-го тура Российской Премьер-Лиги «Сочи» — «Спартак» имел место вопиющий случай, — говорится в заявлении. — Тренер вратарей «Сочи» Дмитрий Бородин позволил себе оскорбительные высказывания в адрес Доменико Тедеско. В частности, Бородин указал на иную национальность нашего главного тренера и призвал его покинуть Россию.ФК «Спартак-Москва» крайне возмущен поведением представителя «Сочи» и считает подобные высказывания недопустимыми. В футболе нет места расизму и национализму! Надеемся, Российский футбольный союз не оставит данный инцидент без внимания и проведет объективное расследование». Российская премьер-лига (РПЛ) заявила о начале проверки по итогам матча. Позднее свою оценку инциденту даст Контрольно-дисциплинарный комитет Российского футбольного союза (КДК РФС). «Спартак» с 35 очками идет в таблице вторым. Команда Тедеско уступает только петербургскому «Зениту», набравшему 38 баллов. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/500x312_crop/media/img/3/68/756077971197683.jpg', 'https://sportrbc.ru/news/5fd544ce9a7947269b4ad0cd?from=newsfeed'),
(3004, 'Патриарх Кирилл попросил прихожан стать донорами плазмы крови', 'Патриарх Московский и всея Руси Кирилл благословил настоятелей храмов Москвы по окончании Божественной литургии 13 и 19 декабря обратиться к клирикам и прихожанам с призывом сдать плазму крови для борьбы с эпидемией коронавирусной инфекции. Об этом сообщает пресс-служба РПЦ. Предстоятель церкви отметил, что переливание плазмы крови сейчас является одним из наиболее эффективных методов лечения COVID-19 для пациентов, переносящих заболевание в тяжелой форме. «Для этих людей данная процедура является иногда последней надеждой на исцеление. Помочь им в этом — наш долг христианской любви», — заявил патриарх Кирилл. Руководитель комиссии по больничному служению при Епархиальном совете Москвы епископ Орехово-Зуевский Пантелеимон, комментируя призыв главы РПЦ, подчеркнул, что сейчас столичные клиники сталкиваются с нехваткой доноров. Кроме того патриарх благословил разместить на информационных стендах и сайтах московских храмов информацию о донорстве. Весной предстоятель РПЦ установил наказание за нарушение священнослужителями санитарных требований, введенных в рамках борьбы с распространением коронавируса. Если действия священников привели к заражению и смерти человека, он может предстать перед церковным судом. В других случаях виновного могут привлечь к церковно-административной ответственности. Осенью во время проповеди в храме Александра Невского в Переделкино патриарх назвал пандемию COVID-19 «последним звонком» и «удивительным уроком» для человечества от Бога. Таким образом люди сейчас получили возможность «увидеть тщетность того, чему отдаются лучшие годы жизни, все силы, все напряжение ума и воли». Коронавирусная инфекция, по его мнению, должна заставить человечество иначе отнестись к своему бытию. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/6/09/756078118413096.jpg', 'https://www.rbc.ru/society/13/12/2020/5fd541c09a794727f0faf155?from=newsfeed'),
(3005, 'Вильфанд пообещал оттепель в регионах Центрального федерального округа', 'В регионах Центрального федерального округа России с четверга, 17 декабря, ожидается оттепель, сообщил ТАСС научный руководитель Гидрометцентра Роман Вильфанд. «В среду температура будет стремиться к нулю градусов, а уже с четверга будут оттепели. Это касается регионов Центрального федерального округа», — рассказал Вильфанд. В Гидрометцентре также пообещали аномально теплую погоду на территории Приволжского федерального округа. В середине недели температура на средней Волге будет превышать норму на 2-4 градуса. «На нижней Волге — около нормы. Заметное повышение», — отметил синоптик. На следующей неделе потеплеет и в Московском регионе, сообщал Вильфанд. С понедельника,14 декабря, температура в столице начнет повышаться. Ночью будет минус 7–9 градусов, по области — до 11 градусов мороза, днем температура составит минус 1–6 градусов. В начале недели возможен небольшой снег. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/500x312_crop/media/img/3/29/756077797775293.jpg', 'https://www.rbc.ru/rbcfreenews/5fd5408e9a79472579873378?from=newsfeed'),
(3006, 'СМИ сообщили о возобновлении рейсов «Аэрофлота» в Хельсинки', 'Авиакомпания «Аэрофлот» с 24 декабря планирует возобновить рейсы из Москвы в столицу Финляндии Хельсинки, подтвердил ТАСС представитель перевозчика в этой стране. Рейсы будут выполняться по четвергам, за исключением 31 декабря, уточнил собеседник агентства. «После этого каждый четверг до конца марта», — добавил он. В ноябре финское издание Yle сообщало, что Финляндия рассматривает возможность к Рождеству разрешить въезд туристам из стран с неблагоприятной эпидемиологической обстановкой. Позже в Главном управлении пограничной службы пояснили, что для российских туристов границы страны в ближайшее время не откроются, решение снять часть ограничений россиян не касается. В августе ЕС обновил список стран, въезд из которых разрешен в Евросоюз. Россия в него вновь не попала. На данный момент россиянам разрешен въезд в Абхазию, Белоруссию, Великобританию, Египет, Казахстан, Киргизию, на Кубу, Мальдивы, в ОАЭ, на Сейшельские острова, в Сербию, Танзанию, Турцию, Швейцарию, Южную Корею, Эфиопию, Японию. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/500x312_crop/media/img/5/12/756076975475125.jpg', 'https://www.rbc.ru/rbcfreenews/5fd5367e9a794721ad9d0f9d?from=newsfeed'),
(3007, 'Глава BioNTech назвал вероятный период спада пандемии COVID-19', 'Пандемию коронавирусной инфекции в США при нормальном процессе вакцинации, возможно, удастся взять под контроль в концу лета 2021 года. Об этом в интервью Fox News заявил Угур Шахин, глава немецкой биоинжиниринговой компании BioNTech, которая вместе с американским фармгигантом Pfizer создала вакцину от COVID-19. По его словам, разница в показателях заболеваемости будет видна, когда будут вакцинированы 30% американцев, что может произойти уже к апрелю. При этом Шахин признал, что у людей есть недоверие к препарату и прививкам, и заверил, что вакцина от Pfizer/BioNTech обладает отличными показателями безопасности. Шахин отметил, что массовая вакцинация и сотрудничество между странами имеют решающее значение в глобальной борьбе с коронавирусной инфекцией, и призвал всех сосредоточиться на этом в ближайшие девять месяцев. По его словам, BioNTech представили властям США подробный план общих усилий для остановки распространения заболевания. Он выразил надежду, что разработчики смогут быстро внедрить свой препарат, что значительно снизит количество госпитализаций. Шахин поприветствовал начала вакцинации в Великобритании, назвав ее «постепенным процессом». Ранее 12 декабря управление по вопросам качества продовольствия и медикаментов США (FDA) разрешило применение вакцины Pfizer/BioNTech в стране в чрезвычайных случаях. Она стала первой одобренной вакциной в Америке. Действующий президент страны Дональд Трамп в связи с этим пообещал начать вакцинацию населения в течение 24 часов — поставки препарата в штаты уже начались. Федеральное правительство заключило с Pfizer контракт стоимостью почти $2 млрд на поставку 100 млн доз вакцины. По итогам последней фазы клинических испытаний препарат показал эффективность в 95%. Глава российского научного центра Гамалеи Александр Гинцбург сообщил, что анализ платформы, на которой создана американо-немецкая вакцина, позволяет предположить, что она будет действовать в течение четырех-пяти месяцев. В то же время созданная центром Гамалеи вакцина «Спутник V», по предварительным данным, будет давать защиту от COVID-19 на протяжении двух лет. ', NULL, 'https://s0.rbk.ru/emitent_pics/resized/40x40_crop/images/69/45/22eb4e9011d875cae6f0fc67b8afc9e0.png', 'https://www.rbc.ru/society/13/12/2020/5fd532229a794720951724b6?from=newsfeed'),
(3008, 'Федеральный суд в Висконсине отклонил иск Трампа', 'Федеральный суд в штате Висконсин отклонил иск президента США Дональда Трампа, который добивается пересмотра результатов выборов главы государства, сообщает Associated Press. Адвокаты Трампа потребовали признать недействительными более 221 тыс. бюллетеней. Американский лидер оспаривает результаты только в двух округах — Милуоки и Дейн, где проиграл выборы, отмечает AP. Представители президента настаивают на том, что бюллетени были поданы с нарушениями. Соперник Трампа, демократ Джо Байден, выигрывает в штате с перевесом в 20,6 тыс. голосов, или в 0,6%. Победа в Висконсине дает ему 10 голосов выборщиков. 3 ноября в Соединенных Штатах прошли президентские выборы. Официально результаты голосования пока не объявлены. Однако американские СМИ отдают победу Байдену, который набирает более 270 необходимых голосов выборщиков. Судьбу кандидатов в президенты 14 декабря решит коллегия выборщиков. Трамп отказывается признать поражение и пытается оспорить результаты в судах. Однако и там американский лидер терпит поражение: большинство исков отклонено. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/500x312_crop/media/img/3/23/756077587088233.jpg', 'https://www.rbc.ru/rbcfreenews/5fd52da09a79471f77ab4eb1?from=newsfeed'),
(3009, 'Фигуристка из России первой в мире попыталась исполнить уникальный прыжок', 'Российская фигуристка Софья Самоделкина первой в мире попробовала исполнить на соревнованиях четверной риттбергер. Спортсменка попыталась выполнить элемент в произвольной программе чемпионата Москвы в категории кандидатов в мастера спорта. Чистого исполнения у 13-летней Самоделкиной не получилось — фигуристка упала, а судьи усмотрели на прыжке недокрут с понижением количества оборотов до трех. Это первая из известных попыток исполнения четверного риттбергера в женских соревнованиях — ранее этот элемент на тренировках демонстрировали только россиянка Александра Трусова и южнокореянка Ю Ен. Помимо риттбергера Самоделкина предприняла попытку выполнить четверной сальхов (с падением). Ошибки на элементах не помешали ей одержать победу — по сумме короткой и произвольной программ спортсменка набрала 200,98 балла. Четверной Риттбергер — один из двух прыжков, пока не исполнявшийся чисто фигуристками на соревнованиях. Второй — аксель, пока не покорился даже мужчинам. В таблице стоимости прыжков риттбергер (10,5 балла) идет вслед за акселем (12,5), лутцем (11,5) и флипом (11). Самоделкина тренируется в школе ЦСКА у Сергея Давыдова. Менее недели назад спортсменка стала победительницей пятого в сезоне этапа Кубка России в соревнованиях юниоров. ', NULL, '', 'https://sportrbc.ru/news/5fd52c789a794720d92db2aa?from=newsfeed'),
(3010, 'Алиев сообщил о создании центра мониторинга России и Турции в Агдаме', 'Центр по мониторингу за прекращением огня в Нагорном Карабахе, создаваемый Россией и Турцией, появится в Агдамском районе, заявил президент Азербайджана Ильхам Алиев на встрече с сопредседателями Минской группы ОБСЕ от Франции и США Стефаном Висконти и Эндрю Шофером, а также с послом России в республике Михаилом Бочарниковым и личным представителем действующего председателя ОБСЕ Анджеем Каспшиком, сообщается на сайте главы государства. «На мой взгляд, это очень хорошее проявление регионального сотрудничества. Это также символ очень приемлемого сотрудничества между Турцией и Россией. Это уже реальность», — сказал Алиев. В начале ноября Армения, Азербайджан и Россия подписали мирное соглашение, оно предусматривает прекращение огня в Нагорном Карабахе, передачу Арменией части территорий Азербайджану и отправку в регион российских миротворцев. Позже Министерства обороны России и Турции подписали меморандум о создании на территории Азербайджана совместного мониторингового центра, который будет контролировать соблюдение режима прекращения огня в регионе. В ноябре Агдамский район перешел под контроль Азербайджана. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/500x312_crop/media/img/0/03/756061373131030.jpg', 'https://www.rbc.ru/rbcfreenews/5fd525d09a79471f77ab4ea6?from=newsfeed'),
(3011, 'Twitter запретил пользователям лайкать посты Трампа про выборы', 'Twitter 12 декабря на время заблокировал пользователям возможность взаимодействия с некоторыми постами действующего президента США Дональда Трампа, передает телеканал Fox News. В частности, утром в субботу пользователи обратили внимание, что при попытке поставить лайк или сделать реплай твитов главы государства социальная сеть выдавала сообщение: «мы пытаемся предотвратить распространение твитов, которые нарушают правила Twitter, поэтому заблокировали большинство способов взаимодействия с этим твитом». При этом возможность ретвитов таких постов сохранилась. Твиты Трампа, взаимодействие с которыми было ограничено, связаны с прошедшими президентскими выборами. В них он утверждал, что одержал победу в голосовании и обвинял губернаторов штатов Аризона и Джорджия в том, что они не предотвратили кражу голосов. Спустя какое-то время возможность лайкать и отвечать на твиты Трампа вернулась. Сейчас при попытке взаимодействия с постом, который Twitter считает спорным, появляется окно с текстом: «Помогите нам обеспечивать достоверность информации в Твиттере. Узнайте подробности, прежде чем ставить отметку «Нравится». С начала предвыборной кампании в США Twitter все чаще стал помечать посты Трампа и его сторонников как спорные, вводящие в заблуждение или нарушающие правила социальной сети. Это происходило как с твитами, посвященными выборам, так и постами на другие темы, например, о пандемии COVID-19. После голосования 3 ноября большая часть твитов действующего президента сопровождались подобными метками. В мае Трамп подписал указ о регулировании соцсетей и предотвращении ими цензуры в интернете. В нем говорится, что онлайн-платформы перестали выполнять функции досок объявлений и пассивных платформ, теперь они сами становятся создателями контента и цензорами мнений. Указ дает возможность подавать в суд на соцсети за необоснованное редактирование или удаление пользовательского контента. После подписания указа президент заявил, что мог бы закрыть Twitter, если бы для этого нашлись законные процедуры. В ноябре, уже после выборов, Трамп заявил, что Twitter вышел из-под контроля благодаря статье 230 Закона об этике в сфере коммуникаций. Она освобождает соцсети от ответственности за публикации пользователей по нескольким законам. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/5/56/756078040867565.jpg', 'https://www.rbc.ru/politics/12/12/2020/5fd51e1a9a79471cfe8660ad?from=newsfeed'),
(3012, 'В Москве от коронавируса умерли 72 человека', 'За последние сутки от коронавирусной инфекции в Москве скончались 72 человека, сообщает оперативный штаб по борьбе с эпидемией. В общей сложности с начала распространения COVID-19 в столице он унес жизни 9 870 жителей. Утром 12 декабря оперативный штаб сообщал о 6,6 тыс. заболевших за 24 часа. Всего коронавирус выявили почти у 686 тыс. москвичей. В субботу, по подсчетам оперативного штаба, в России выявили более 28 тыс. новых заболевших и зафиксировали 560 смертей. Общее количество умерших составило почти 46,5 тыс. случаев. При этом показатели смертности в подсчетах Росстата отличаются от цифр оперативного штаба в большую сторону. С апреля по октябрь ведомство насчитало 78,6 тыс. летальных исходов. Это объясняется разной методологией подсчетов: Росстат включает в них умерших от других заболеваний, обострившихся на фоне COVID-19, а также тех, у кого коронавирус обнаружили уже после смерти. Мэр Москвы Сергей Собянин, оценивая китайскую методику борьбы с коронавирусной инфекцией (когда при нескольких заболевших закрывают города и проводят тотальное тестирование) назвал ее эффективной, но совершенно не подходящей для российской столицы. В Москве на прошлой неделе началась масштабная вакцинация граждан от COVID-19. В первую очередь прививаются медики, педагоги, соцработники и сотрудники силовых структур. По словам Собянина, в столице нужно привить не менее 6-7 млн человек. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/5/96/756078064132965.jpg', 'https://www.rbc.ru/society/12/12/2020/5fd522a89a79471df6b4807e?from=newsfeed'),
(3013, 'Джошуа победил Пулева и защитил титулы чемпиона мира по боксу', 'Британец Энтони Джошуа победил болгарина Кубрата Пулева в ночь на воскресенье в боксерском поединке, который прошел в Лондоне. Джошуа победил Пулева нокаута в девятом раунде 12-раундового поединка. Благодаря победе Джошуа защитил титулы чемпиона мира в супертяжелом весе по версиям Всемирной боксерской ассоциации (WBA, с приставкой «супер»), Всемирной боксерской организации (WBO) и IBF. Для звания абсолютного чемпиона мира ему не хватает титула Всемирного боксерского совета (WBC), которым владеет соотечественник Тайсон Фьюри, лучший боксер вне зависимости от весовой категории по версии авторитетного журнала The Ring. В активе 31-летнего Джошуа 24 победы, одно поражения. На счету 39-летнего Пулева 28 побед и два поражения. Для болгарина это поражение стало первым с 2014 года, когда он проиграл украинцу Владимиру Кличко. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/500x312_crop/media/img/1/95/756077636115951.jpg', 'https://sportrbc.ru/news/5fd5343a9a794720808d4e0c?from=newsfeed'),
(3035, 'Собянин исключил ограничения на продажу алкоголя в Новый год', 'Власти Москвы не будут вводить ограничения на продажу алкоголя в новогодние праздники, так как не видят в этом смысла, заявил мэр столицы Сергей Собянин в фильме Наили Аскер-заде «Опасный вирус. Первый год» на канала «Россия 1». «В мире вообще богатый опыт введения сухих законов, как правило, это все заканчивалось повальным пьянством, поэтому не вижу никакого смысла в этом», — пояснил мэр (цитата по «РИА Новости»). Собянин также отметил, что не планирует вводить ограничения по количеству людей при встречах или комендантский час на праздники. Материал дополняется. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/3/15/756078633903153.jpg', 'https://www.rbc.ru/society/13/12/2020/5fd607a19a79474fc4543fdc?from=newsfeed'),
(3036, 'Стали известны дата и место прощания с Гафтом', 'Прощание с народным артистом РСФСР Валентином Гафтом, скончавшимся на 86-м году жизни, состоится 15 декабря в театре «Современник». Об этом сообщает ТАСС со ссылкой на вдову актера Ольгу Остроумову. «В «Современнике» с 10:00, наверное, до 12:00. Во вторник», — сказала она на вопрос о времени и месте прощания. Ранее источник РБК сообщил, что Гафта похоронят в Москве, на Троекуровском кладбище, 15 декабря. При этом он уточнял, что это еще не окончательная информация. Позже директор театра Игорь Попов подтвердил «РИА Новости», что похороны пройдут 15 декабря. Валентин Гафт умер от инсульта 12 декабря. Артист был известен своими ролями в фильмах «Чародеи», «Небеса обетованные», «Семнадцать мгновений весны», «12» и других. В театре «Современнник» он играл с 1969 года. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/4/80/756078627111804.jpg', 'https://www.rbc.ru/rbcfreenews/5fd5ffee9a79474d2531f771?from=newsfeed'),
(3037, 'Собянин назвал условие для ужесточения ограничений в Москве', '«Ужесточение возможно только в том случае, когда медицинская система перестает справляться с потоком пациентов, такого в Москве нет», — цитирует его агентство ТАСС. Мэр также отметил, что сейчас у городской медицинской системы «достаточно большой» запас прочности, и в ближайшее время ужесточение эпидемиологических мер москвичам не грозит. Ранее глава города оценил выработанную в Китае систему, согласно которой в качестве эпидемиологических мер против COVID-19 изолировались целые микрорайоны. По мнению Собянина, она совершенно неприменима для России, хотя является «эффективным методом» в борьбе с распространением коронавируса. По данным оперативного штаба, за минувшие сутки в Москве коронавирусом заразились более 6,4 тыс. человек. Всего в городе за время пандемии зафиксировали свыше 692 тыс. случаев заражения. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/2/08/756078631479082.jpg', 'https://www.rbc.ru/rbcfreenews/5fd6046b9a79474f0f56e0b0?from=newsfeed'),
(3038, 'Умер «голос Кремля» Евгений Хорошевцев', 'На 77-м году жизни скончался актер и диктор Евгений Хорошевцев. Об этом журналистам сообщил пресс-секретарь президента России Дмитрий Песков. «Евгений Александрович был народным артистом России, «голосом Кремля». Именно его голос все слышали в комментариях на параде, на всех торжественных мероприятиях с участием главы государства», — сообщил он. Песков напомнил, что Хорошевцев был учеником Юрия Левитана. Как отметил пресс-секретарь, Путин выразил соболезнования родным и близким артиста. Евгений Хорошевцев родился в Москве в июле 1944 года. В возрасте девяти лет начал занимался в театральной студии В.В.Книппера Дома культуры им. Зуева. Спустя семь лет устроился на работу в Москонцерт. Получил актерское образование в молодежной театральной студии при Москонцерте. Затем окончил факультет эстрадного искусства в ГИТИСе по специальности «режиссер музыкального театра, режиссер эстрады и массовых представлений». Сыграл несколько ролей в кино. С 1968 года — режиссер Всесоюзного радио. Совместно с диктором Юрием Левитаном вел праздничные демонстрации, посвященные 1 Мая и годовщинам Октябрьской социалистической революции. Также на Всесоюзном радио после трансляции боя часов Спасской башни оповещал о начале программы «Время, события, люди». С мая 2000 года работал диктором протокольных мероприятий президента России. С 2007 года был диктором парадов Победы на Красной площади. Вместе с Анной Шатиловой вел торжественные марши в честь парада Красной армии 7 ноября 1941 года. С 2009 года был ведущим военно-музыкального фестиваля «Спасская башня». Хорошевцев имеет несколько званий и наград. В 1990 году ему присвоили почетное звание Заслуженный деятель искусств РСФСР. В 2001 году он удостоился звания Народный артист России. В 2010-м Хорошевцева наградили орденом Почета, а спустя четыре года — орденом Дружбы. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/7/74/756078618973747.jpg', 'https://www.rbc.ru/society/13/12/2020/5fd603959a79474e7fb4117e?from=newsfeed'),
(3039, 'Попова назвала дату появления в России нулевого пациента с COVID-19', 'Нулевого пациента, с которого в России началось распространение коронавируса COVID-19, удалось выявить 1 марта. Об этом в интервью для фильма Наили Аскер-заде «Опасный Вирус. Первый год» на телеканале «Россия-1» заявила глава Роспотребнадзора Анна Попова. «Да, конечно, мы знаем [нулевого пациента], он появился у нас буквально 1 марта», — сказала она. Как отметила Попова, к 17 марта в России зафиксировали уже сотый случай заражения. «Мы говорим сейчас уже о том, кто распространял инфекцию», — добавила глава Роспотребнадзора. Она напомнила, что первые случаи заражения коронавирусом в России были выявлены еще в январе. Они были завезены из Китая, где произошла вспышка COVID-19. «Но тогда нам удалось, при плотности контроля, не допустить распространения», — отметила Попова. По ее словам, когда в Китае определились со свойствами коронавируса, стало понятно, что «нужно разворачивать все мероприятия». «В 20-х числах января докладывали с Татьяной Алексеевной Голиковой, с министром здравоохранения президенту Российской Федерации, <...> стало понятно, что это не просто обычный какой-то сезонный новый вирус. Что именно вирус с пандемическим потенциалом», — заключила она. В апреле заведующий кафедрой госпитальной терапии Российского национального исследовательского медицинского университета им. Н.И. Пирогова, академик РАН Александр Чучалин говорил, что нулевым пациентом с коронавирусом в России оказался мужчина, прилетевший из Италии. «У нас в России таким нулевым пациентом явился молодой мужчина 40 с лишним лет. Прилетел он из Милана», — сказал Чучалин. Он уточнил, что коронавирус у заболевшего обнаружили быстро, диагностировали 27 февраля. По словам академика, заразились также пожилые отец и мать пациента, с которыми он контактировал. Из-за возраста их заболевание протекало тяжело, отец мужчины находился на искусственной вентиляции легких. «Человек, названный в качестве нулевого, мог быть первым, у которого вирус был зафиксирован в нашей стране, однако он не был тем, от кого пошла вся эта беда, потому что, кроме него, тех, кто завез инфекцию, было много, может быть, одновременно. Этого человека уместно назвать не нулевым, а первым зафиксированным», — констатировал Чучалин. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/3/29/756078622153293.jpg', 'https://www.rbc.ru/society/13/12/2020/5fd601de9a79474bacdbb2ea?from=newsfeed'),
(3040, 'Россиянки не попали в десятку в гонке преследования на этапе Кубка мира', 'Сборная России по биатлону обновила антирекорд по количеству гонок подряд (32) без попадания в тройку лучших на этапах Кубка мира. 13 декабря на этапе Кубка мира в Хохфильцене ни одна из россиянок не смогла пробиться на пьедестал по итогам гонки преследования. Более того, ни одна из россиянок не вошла в десятку лучших. Лучшей среди представителей сборной России стала Ирина Казакевич (два промаха, плюс 1 минута 37,5 секунды отставания от победителя), завершившая гонку 14-й. Выиграла гонку преследования норвежка Марте Олсбю-Ройселанн. Она на четырех огневых рубежах допустила два промаха и показала время 29 минут 4,6 секунды. Второе место заняла Динара Алимбекова из Белоруссии (ноль промахов, отставание 13,9 секунды), третьей стала француженка Жюлья Симон (три, плюс 17,8). На четвертое место с 29-й стартовой позиции поднялась шведка Ханна Эберг (ноль, плюс 21,4). Россиянка Лариса Куклина (три промаха, плюс 2.19,3) — 23-я, Ульяна Кайшева (четыре промаха плюс 2.32,4) — 27-я, Евгения Павлова (четыре промаха, плюс 3.33,7) — 42-я. Этап Кубка мира в Хохфильцене продолжится в воскресенье мужской эстафетной гонкой, она начнется в 16:00 мск. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/8/56/756078606949568.jpg', 'https://sportrbc.ru/news/5fd600d79a79474e5e1e778d?from=newsfeed'),
(3041, 'Токсиколог назвал вымыслом данные о повторном отравлении Навального', 'Посторонние никак не могли попасть в палату больницы в Омске, где находился Алексей Навальный. Версия о попытке повторного отравления оппозиционера является вымыслом. Об этом заявил заведующий отделением острых отравлений омской больницы, главный токсиколог Омской области и Сибирского федерального округа Александр Сабаев. «Никаких вопросов ни с чьей стороны к нам не возникало. Никто, кроме медицинских работников, доступа к нему не имел. Все это вымысел от начала до конца», — сказал он. По его словам, «не было отравления ни первичного, ни вторичного». «Это информационная «утка», все раскручивается ради каких-то определенных целей», — считает Сабаев. Ранее газета The Sunday Times сообщила, что, когда Навальный в состоянии комы находился в омской больнице, якобы была предпринята вторая попытка его отравить. Материал дополняется. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/2/71/756078607957712.jpg', 'https://www.rbc.ru/politics/13/12/2020/5fd5fd969a79474d231989c9?from=newsfeed'),
(3042, 'На верфи в Мурманске загорелось рыболовецкое судно «Вега»', ' На рыболовецком судне «Вега», стоявшем на причале Мурманской судоверфи, произошел пожар. Об этом сообщает региональный главк МЧС. К 12:47 мск удалось локализовать возгорание и ликвидировать открытое горение. С судна эвакуировали трех человек, пострадавших нет, отметили в ведомстве. Как сообщает агентство Nord-News, Северо-Западная транспортная прокуратуре организовала проверку по факту пожара. По информации ведомства, возгорание могло произойти при проведении сварочных работ. Ранее в городе Кузнецке Пензенской области произошел пожар на мебельном складе готовой продукции. Огонь охватил площадь 800 кв. м, его тушили 26 человек. В МЧС сообщили, что информация о пострадавших не поступала. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/100x75_crop/media/img/8/47/756078599266478.jpg', 'https://www.rbc.ru/rbcfreenews/5fd5fa1b9a79474baa38a058?from=newsfeed'),
(3043, 'В Германии закроют магазины и ограничат продажу алкоголя из-за COVID-19', 'Власти Германии вводят в стране с 16 декабря по 10 января жесткие ограничительные меры, чтобы снизить темпы распространения коронавирусной инфекции. Об этом сообщила канцлер ФРГ Ангела Меркель по итогам совещания с премьер-министрами федеральных земель, передает Tagesschau. «Мы вынуждены действовать и делаем это сейчас», — сказала Меркель. Канцлер сообщила, в Германии с 16 декабря закрываются магазины розничной торговли, кроме продуктовых и «реализующих товары повседневного пользования». Также не будут работать парикмахерские, а продажа пиротехники будет запрещена. Материал дополняется.  ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/3/11/756078590811113.jpg', 'https://www.rbc.ru/society/13/12/2020/5fd5f7709a79474ac7033b3d?from=newsfeed'),
(3044, 'Лыжница Ступак стала второй в гонке на 10 км на этапе Кубка мира', 'Россиянка Юлия Ступак завоевала серебряную медаль в гонке с раздельным стартом свободным стилем на 10 км на втором этапе Кубка мира в Давосе (Швейцария). Победу одержала американка Рози Бреннан, показавшая время 24 минуты 49,8 секунды, Ступак уступила ей 34 секунды. Бронза у другой представительницы США — Хейли Свирбул (+40,5). Россиянка Наталья Непряева заняла четвертое место, Татьяна Сорина — шестое, Алиса Жамбалова — 13-е, Анна Нечаевская — 15-е, а Яна Кирпиченко — 16-е. Сорина поднялась на второе место в общем зачете Кубка мира после шести гонок, набрав 318 очков. Лидирует Рози Бреннан с 377 баллами. Соревнования проходят без участия спортсменов из сборных Норвегии, Финляндии и Швеции, которые приняли решение сняться с декабрьских этапов Кубка мира из-за риска заражения коронавирусом.   ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/5/73/756078594918735.jpg', 'https://sportrbc.ru/news/5fd5f6a49a79474a850bdbc9?from=newsfeed'),
(3045, 'В Баку сообщили об антитеррористической операции в Карабахе', 'Служба государственной безопасности Азербайджана провела «вынужденную антитеррористическую операцию» в окрестностях поселка Гадрут в Карабахе. Об этом сообщается в совместном заявлении СГБ и Минобороны республики. Как объяснили в Баку, некоторые вооруженные формирования Армении оставались в лесистой местности в северо-западной части поселка Гадрут Ходжавендского района Азербайджана даже после подписания соглашения о прекращении огня. По информации Азербайджана, в Армении сообщали, что эти вооруженные формирования заблудились в лесистой местности, Ереван просил российских миротворцев вывести их с этой территории. «Армянские вооруженные отряды не покинули территорию, наоборот, создали боевые позиции и в последние дни совершили террористически-провокационные и диверсионные действия», — говорится в заявлении. В частности, Минобороны Азербайджана сообщает, что 26 ноября в селе Сур Ходжавендского района армяне внезапно напали на азербайджанских военнослужащих. В результате трое военнослужащих погибли и двое получили ранения. Также 8 декабря погиб еще один азербайджанский военный. «Учитывая вышесказанное, Служба государственной безопасности Азербайджанской Республики была вынуждена провести антитеррористическую операцию в этом районе», — сообщили СГБ и Минобороны. Ранее Минобороны Армении сообщило, что вооруженных силы Азербайджана нарушили перемирие, нанеся удар по селам Хин Тагер и Хцаберд Гадрутского района Карабаха. В результате ранения получили шесть армянских военнослужащих, Азербайджан также понес потери, отметили в ведомстве. В Ереване действия Азербайджана назвали «провокацией». ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/7/76/756078586182767.jpg', 'https://www.rbc.ru/rbcfreenews/5fd5f1a69a794749092e8d6d?from=newsfeed'),
(3046, 'Экс-игрока «Спартака» Квинси Промеса арестовали за нанесение ударов ножом', 'Полузащитник голландского «Аякса» Квинси Промес арестован по подозрению в нанесении ножевых ранений, сообщает De Telegraaf. По информации издания, инцидент с участием Промеса произошел в конце июля во время семейной вечеринки. В ходе потасовки Промес ударил ножом одного из членов своей семьи. Пострадавший мужчина сообщил о случившемся месяц назад, после чего началось расследование, которое привело к аресту игрока. Футболисту грозит тюремное заключение сроком на четыре года. В настоящий момент Промес находится в СИЗО «РБК Спорт» направил запрос в пресс-службу полиции центральных Нидерландов и в «Аякс». Голландец выступает за «Аякс» с лета 2019-го года. В нынешнем сезоне он провел 12 матчей за клуб в чемпионате Нидерландов, забил пять мячей. Также на его счету пять матчей на групповом этапе Лиги чемпионов. Ранее футболист играл в составе голландского «Твенте», испанской «Севильи», а также московского «Спартака», с которым он завоевал золото чемпионата России. 28-летний хавбек выступал за «красно-белых» с 2014 по 2018 год ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/8/73/756078582175738.jpg', 'https://sportrbc.ru/news/5fd5f4729a79474a0bdf3813?from=newsfeed'),
(3047, 'Песков ответил на вопрос о жизни Путина в бункере', 'Президент Владимир Путин живет своей подмосковной резиденции в Ново-Огареве. Так его пресс-секретарь Дмитрий Песков ответил на вопрос о том, действительно ли глава государства «живет в бункере», передает «РИА Новости». «Путин сейчас живет в Ново-Огареве, собственно, где он и жил и до. До пандемии», — сказал он. Песков также добавил, что оттуда президент иногда приезжает в Кремль или отправляется в командировки. Материал дополняется. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/4/92/756078657710924.jpg', 'https://www.rbc.ru/rbcfreenews/5fd60d5e9a794750aa8293f4?from=newsfeed'),
(3048, 'Песков сообщил о планах Путина на новогоднюю ночь', 'Президент Владимир Путин встретит Новый год с близкими, как он делает каждый год. Об этом рассказал его пресс-секретарь Дмитрий Песков в фильме «Опасный вирус. Первый год» на телеканале «Россия 1». «Где он [Путин] будет встречать Новый год, я не знаю, но с большой долей уверенности вам могу сказать, что он будет встречать с родными и близкими, как он это делает ежегодно», — сказал Песков (цитата по ТАСС). Пресс-секретарь также отметил, что полноценно президент никогда не отдыхает и на праздниках «может быть, как-то дух переведет». Ранее Песков заявил, что Владимира Путина не беспокоят публикации о его окружении и личной жизни. Тогда пресс-секретарь объяснил, что они постоянно сопровождают главу государства и он не обращает на них внимания. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/2/86/756078645348862.jpg', 'https://www.rbc.ru/rbcfreenews/5fd609239a79474fa84468f5?from=newsfeed'),
(3049, '«Спартак» подаст жалобу на судейство в матче с «Сочи»', '«Спартак» направит жалобу в экспертно-судейскую комиссию при президенте Российского футбольного союза (ЭСК РФС) из-за неназначения двух пенальти в матче 18-го тура Российской премьер-лиги (РПЛ) против «Сочи» (0:1), сообщает «Чемпионат» со ссылкой на главу департамента по коммуникациям «красно-белых» Антона Фетисова. «Будет жалоба на неназначение двух пенальти», — сказал Фетисов. На 44-й минуте игры защитник «Сочи» Ибрагим Цаллагов рукой коснулся мяча в своей штрафной площади, но главный арбитр встречи Игорь Панин не стал назначать пенальти. На 53-й минуте игры судья не назначил пенальти в эпизоде с блокировкой защитника «Спартака» Самуэля Жиго со стороны игрока хозяев в штрафной площади сочинцев. По итогам матча на стадионе «Фишт» разразился скандал. Главный тренер «Спартака» Доменико Тедеско заявил, что футболист «Сочи» ударил его помощника Андреаса Хинкеля. Кроме того, специалист рассказал, что в перерыве встречи тренер вратарей «Сочи» Дмитрий Бородин позволил себе оскорбительные высказывания в его адрес с указанием на иную национальность специалиста. Российская премьер-лига (РПЛ) заявила о начале проверки по итогам матча. После 18 матчей «Спартак» занимает второе место в турнирной таблице с 35 очками. В 19-м туре москвичи в Санкт-Петербурге сыграют с лидирующим «Зенитом» (38 баллов). Встреча пройдет 16 декабря и начнется в 20:00 мск. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/1/27/756078623834271.jpg', 'https://sportrbc.ru/news/5fd606779a79474e85429267?from=newsfeed'),
(3059, 'Итальянский советник Федуна стал трансферным консультантом «Спартака»', 'Агент Франко Камоцци подписал контракт со «Спартаком» и стал трансферным консультантом «красно-белых», сообщает «Спорт-Экспресс» со ссылкой на главу департамента по коммуникациям «Спартака» Антона Фетисова. Ранее Камоцци являлся советником владельца московского клуба Леонида Федуна. «Клуб подписал с Франко Камоцци договор на оказание консалтинговых услуг. В том случае, если его консультации приведут к трансферу футболиста, он будет получать вознаграждение. Камоцци работает непосредственно с Дмитрием Поповым и консультирует скаутов «Спартака» по европейскому рынку, не являясь при этом штатным сотрудником клуба», — сказал Фетисов. 8 декабря, спустя всего пять месяцев работы, «Спартак» покинул гендиректор Шамиль Газизов. Функционер рассказал, что разночтения с руководством, приведшие к отставке, были вызваны, в частности, назначением в ноябре спортивным директором Дмитрия Попова. По информации «РБ-Спорт», из-за прихода Попова полномочия Газизова сократились. После отставки Газизова руководство клубом возложили на управляющего директора Евгения Мележикова. Трансферную стратегию в «Спартаке» теперь будет определять Дмитрий Попов. Также он станет заниматься управлением спортивным блоком и построением вертикали взаимодействия команд «Спартака» всех возрастов — от академии до основы. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/3/31/756078638457313.jpg', 'https://sportrbc.ru/news/5fd60be59a7947508febee0c?from=newsfeed'),
(3071, '«Тамбов» проиграл «Рубину» и потерпел шестое поражение подряд', 'В матча 18-го тура Российской премьер-лиги «Тамбов» проиграл казанскому «Рубину» со счетом 0:1. Матч прошел на стадионе «Мордовия Арена» в Саранске, домашней арене для «Тамбова» в нынешнем сезоне. Единственный мяч на 20-й минуте забил Илья Самошников. Он впервые отличился в нынешнем сезоне чемпионата России. «Тамбов» проиграл шестую встречу подряд, безвыигрышная серия команды составляет семь матчей. В последний раз тамбовчане побеждали в РПЛ 18 октября, обыграв «Ротор» (2:0). Казанцы набрали 27 очков и поднялись на восьмое место в турнирной таблице. «Тамбов» имеет в активе 12 баллов и располагается на 15-й позиции в таблице. В заключительном матче года «Тамбов» также в Саранске примет «Урал» 18 декабря, а «Рубин» на выезде сыграет против «Ахмата» 17 декабря. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/0/52/756078652085520.jpg', 'https://sportrbc.ru/news/5fd6118f9a794752439193cf?from=newsfeed'),
(3095, '«Краснодар» разгромил «Локомотив» со счетом 5:0', 'В матче 18-го тура Российской премьер-лиги (РПЛ) «Краснодар» переиграл «Локомотив». Поединок прошел в Краснодаре на одноименном стадионе и завершился со счетом 5:0. В составе «быков» дубль оформил Маркус Берг, по мячу забили Виктор Классон, Реми Кабелла и Магомед-Шапи Сулейманов. В конце первого тайма «железнодорожники» не реализовали пенальти — Антон Миранчук с 11-метровой точки попал во вратаря. Эта победа стала крупнейшей в противостоянии команд. «Краснодар» впервые с 1 сентября 2018 года обыграл «Локомотив», прервав четырехматчевую серию без побед. В турнирной таблице РПЛ «Локомотив» с 28-ю очками занимает седьмое место, «Краснодар» с 27-ю баллами идет на восьмой позиции. В следующем туре «быки» примут «Уфу», «железнодорожники» встретятся на выезде с подмосковными «Химками». Оба матча пройдут 17 декабря. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/9/90/756078742446909.jpg', 'https://sportrbc.ru/news/5fd6330f9a794759b4721b3e?from=newsfeed'),
(3096, 'Проценко назвал срок пиковых осложнений при COVID-19', 'Пик проблем со здоровьем у зараженных коронавирусной инфекцией приходится на 7–10 день болезни. Об этом рассказал главный врач больницы № 40 в московской Коммунарке Денис Проценко в фильме «Опасный вирус. Первый год» на телеканале «Россия 1». «Самый пик, пик всех проблем — это где-то 7–10-е сутки заболевания», — сказал он (цитата по «РИА Новости»). Глава больницы также рассказал, что проявления хронического COVID-19 могут быть совершенно разными. Например, это могут быть дерматологические проявления, депрессия или «какие-то парасуицидальные мысли». Ранее Проценко сообщал, что треть больных с COVID-19 умирают в первые 72 часа после госпитализации. Он объяснил, что чаще всего это происходит из-за гипоксии и тромбоэмболии. При этом те пациенты, которые скончались позже, в большинстве случаев умерли от септических осложнений. В организме зараженного коронавирусом человека специальные бактерии, которые приводят к смерти от такого рода осложнений, быстро развиваются. По данным оперативного штаба, за минувшие сутки в России коронавирусом заразились более 28 тыс. человек. Всего за время пандемии в стране обнаружили свыше 2,6 млн случаев заражения. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/3/06/756078746352063.jpg', 'https://www.rbc.ru/rbcfreenews/5fd62cca9a79475835deb7cb?from=newsfeed'),
(3097, 'Путин борется с ценами на продукты, умер Гафт. Главные новости РБК', 'Путин потребовал решить вопрос с ценами на продукты Президент Владимир Путин во время совещания с членами правительства раскритиковал главу Минэкономразвития Максима Решетникова за «эксперименты» с ценами на продукты и дал неделю на то, чтобы принять меры по сдерживанию роста цен. Армения и Азербайджан обвинили друг друга в нарушении перемирия в Карабахе 12 декабря в Ереване заявили, что вооруженные силы Азербайджана начали наступление в южной части Нагорного Карабаха. Вскоре Баку выступил с аналогичными обвинениями в адрес Армении. Обе стороны призвали отреагировать на произошедшее российских миротворцев, которые находятся в спорном регионе по условиям мирного соглашения. В Москве на 86-м году жизни умер Валентин Гафт О смерти народного артиста РСФСР стало известно в субботу. Коллеги, друзья, представители власти и общественности выразили соболезнования. Times сообщила о второй попытке отравления Навального перед перелетом в Берлин   По информации британской газеты, агенты российской госбезопасности пытались повторно отравить оппозиционера Алексея Навального перед его отправкой в берлинскую клинику «Шарите». «Спартак» обвинил футболиста «Сочи» в нападении на помощника тренера после матча Тренер москвичей Доменико Тедеско заявил, что один из членов сочинской команды ударил его помощника Андреаса Хинкеля. Конфликт произошел после встречи на стадионе «Фишт» в Сочи, где хозяева поля одержали победу над «Спартаком» со счетом 1:0. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/6/69/756078413040696.jpg', 'https://www.rbc.ru/ins/society/13/12/2020/5fd54e5e9a794727f0faf15b?from=newsfeed'),
(3098, 'Квят оказался вне десятки в последней гонке сезона «Формулы-1»', 'Российский пилот Alpha Tauri Даниил Квят финишировал 11-м в заключительной гонке сезона «Формуле-1», Гран-при Абу-Даби. Эта гонка может стать для него последней в элитной серии гонок, так как в следующем сезоне его должен сменить в команде японец Юки Цунода. Победителем Гран-при Абу-Даби стал голландский пилот Red Bull Макс Ферстаппен. Второе место занял финский пилот Mercedes Валттери Боттас, третьим стал его партнер по команде британец Льюис Хэмилтон, досрочно завоевавший титул в этом сезоне. Победитель предыдущего этапа Серхио Перес сошел в начале гонки из-за технических проблем. Мексиканец провел последнюю гонку за Racing Point. Партнер Квята по команде, француз Пьер Гасли, финишировал восьмым. Победив в текущем сезоне, 35-летний Хэмилтон стал семикратным чемпионом мира по автогонкам, догнав по количеству титулов немца Михаэля Шумахера. В этом сезоне Хэмилтон также побил рекорд Шумахера по числу побед на этапах Гран-при (95). Кроме того, команда Mercedes досрочно стала обладателем Кубка конструкторов нынешнего сезона. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/5/89/756078737976895.jpg', 'https://sportrbc.ru/news/5fd62fec9a79475908e0d386?from=newsfeed'),
(3099, 'Минобороны сообщило о соблюдении режима прекращения огня в Карабахе', '«На двадцати трех наблюдательных постах российскими миротворцами ведется круглосуточный мониторинг обстановки и контроль за соблюдением режима прекращения огня. Режим прекращения огня соблюдается по всей линии соприкосновения», — говорится в сообщении. В пресс-службе также подчеркнули, что за минувшие сутки российские миротворцы обеспечили безопасное возвращение 634 беженцев из Армении в Нагорный Карабах. Всего на территорию непризнанной республики вернулись более 38 тыс. человек. Ранее, 11 декабря, ведомством был зафиксирован один случай нарушения режима прекращения огня в Гадрутском районе. Однако нового обострения конфликта миротворцы не допустили. В нарушении договоренностей Баку и Ереван обвинили друг друга. После продолжительных боевых действий 9 ноября, главы Армении, Азербайджана и России подписали договор о прекращении огня на линии соприкосновения в Нагорном Карабахе. Чтобы обеспечить выполнение соглашения, Россия направила в зону конфликта около 2 тыс. миротворцев, которые будут контролировать ситуацию следующие пять лет. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/2/61/756078732821612.jpg', 'https://www.rbc.ru/rbcfreenews/5fd624b79a7947562b0c4dcb?from=newsfeed'),
(3100, 'Российские биатлонисты остались четвертыми в эстафете на этапе Кубка мира', 'Мужская сборная России заняла четвертое место в эстафете 4х7,5 км на третьем этапе Кубка мира по биатлону, который проходит в австрийском Хохфильцене. В составе команды участие принимали Матвей Елисеев, Евгений Гараничев, Эдуард Латыпов и Александр Логинов. Победителем эстафеты стала сборная Швеции. Представители этой команды использовали в гонке восемь дополнительных патронов и прошли дистанцию с результатом 1 час 16 минут 31,5 секунды. Второе место заняли норвежцы, третье — немцы. Россияне отстали от победителей на 1 минуту 13,5 секунды. Сборная России обновила антирекорд по проведенным подряд гонкам без медалей на этапах Кубка мира, команда не может подняться на пьедестал на протяжении 33 гонок. Следующий этап Кубка мира также пройдет в Хохфильцене с 17 по 20 декабря. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/4/96/756078708672964.jpg', 'https://sportrbc.ru/news/5fd624099a794756f858ab2c?from=newsfeed'),
(3101, 'Специалисты оценили данные о способности зубной пасты уничтожать COVID-19', 'Зубные пасты и ополаскиватели могут уничтожить до 99,9% коронавируса, находящегося в полости рта, однако уже больного человека это не вылечит, поскольку вирус распространился по организму за пределы носоглотки. Об этом рассказал РБК ведущий научный сотрудник Федерального исследовательского центра фундаментальной и трансляционной медицины (ФИЦ ФТМ), профессор вирусологии Александр Чепурнов. 11 декабря на сайте в медицинском журнале Британской стоматологической ассоциации British Dental Journal было опубликовано исследование, согласно которому зубные пасты, содержащие цинк или олово, могут нейтрализовать коронавирус на 99,9% за две минуты. Также среди эффективных средств исследователи выделили средства с хлоридом цетилпиридиния — элементом, входящим в состав ополаскивателей для полости рта, спреев, пастилок и зубных паст. Ему на уничтожение коронавируса потребовалось 30 секунд. «Цифра в 99,9% процента, достаточно внушительная в бытовом рассуждении, в микробиологии играет другую роль. Приведу простой пример — у меня на пике инфекции в смыве ротоглотки отбиралась проба, которая соответствовала миллиону миллионов частиц вируса в одном миллилитре. Если это количество уменьшить на 99,9%, то еще тысяча миллионов останется, а этого более чем достаточно для того, чтобы заразиться», — заявил он. В то же время Чепурнов отметил, что данные меры могут помочь при профилактике. В частности, меньшее количество вируса в носоглотке уже болеющего человека способно уменьшить его заразность, так как уменьшит количество частиц вируса в среде вокруг вокруг больного, которое может выбрасываться, например, при разговоре. «Это, возможно, будет работать как профилактическое средство для еще не заразившихся, если предположить, что человек где-то оказался в сомнительной ситуации, пришел и прополоскал роль предложенными препаратами», — добавил он. Специалист обратил внимание и на то, что исследование проводилось с участием Colgate — одного из брендов, производящих жидкости для ополаскивания полости рта и заинтересованных в продвижении своей продукции как эффективной против коронавирусной инфекции. «Если бы исследование проводилось не с участием Colgate, а, скажем, с Johnsohn and Johnson, который выпускает Listerine, тоже очень популярный ополаскиватель, то мы бы получили похожие результаты исследования. Например, было исследование, которое доказывало его эффективность против герпеса и ряда вирусов гриппа. В целом, это все работает, но очень недолго», — заявил Чепурнов. Инфекционист, доктор медицинских наук Николай Малышев в разговоре с РБК усомнился в том, что средства для обработки полости рта могут эффективно противостоять коронавирусной инфекции. «Применили пасту, но через несколько минут эффект исчезнет. Много есть средств, способных продезинфицировать полость рта — смородиновый сок, разные спирты. Что касается профилактики, то тут я отвечу шуткой — лучше коньячком или водочкой рот прополоскать, какие тут проблемы», — заявил он. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/9/21/756078700236219.jpg', 'https://www.rbc.ru/rbcfreenews/5fd61eb09a794754fc2abef2?from=newsfeed');
INSERT INTO `news` (`id`, `title`, `content`, `status`, `picture`, `url`) VALUES
(3102, 'Власти Ямала объявили 31 декабря выходным днем', 'В Ямало-Ненецком автономном округе 31 декабря будет выходным днем. Об этом сообщило агентство «Интерфакс» со ссылкой на пресс-службу главы региона Дмитрия Артюхова. «Перенесен выходной день для объявления 31-го нерабочим. Это касается органов госвласти и муниципальных органов власти, всем остальным это рекомендовано», — говорится в сообщении. В пресс-службе также уточнили, что вместо этого рабочим днем будет суббота 19 декабря. Официально 31 декабря останется рабочим днем, как и в предыдущие годы. Однако власти регионов могут самостоятельно объявить этот день выходным. Такое решение уже приняли правительства более 20 регионов России, в том числе Бурятии, Мурманской, Вологодской, Орловской, Саратовской, Волгоградской и Костромской областей, Чувашии, Камчатки, Сахалина и других. При этом в Башкирии, республике Марий Эл, а также в Калининградской, Ленинградской, Псковской, Новгородской, Омской и Курганской областях 31 декабря останется рабочим днем. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/7/04/756078684706047.jpg', 'https://www.rbc.ru/rbcfreenews/5fd619969a794753e9c68134?from=newsfeed'),
(3103, 'Президент «Сочи» Ротенберг призвал дисквалифицировать Тедеско', 'Президент «Сочи» Борис Ротенберг призвал дисквалифицировать главного тренера «Спартака» Доменико Тедеско по итогам матча 18-го тура Российской премьер-лиги (РПЛ), сообщает «Спорт-экспресс». Сочинцы выиграли в поединке со счетом 1:0. «Поведение Тедеско просто порочит наш футбол. Если потерпел поражение — прими достойно этот результат. Помните, Владимира Федотова дисквалифицировали на несколько матчей? Когда он предъявил претензии судье? Считаю, Тедеско за его поступок тоже надо дисквалифицировать на несколько встреч! Что он себе сейчас позволил?» — сказал Ротенберг. По мнению руководителя «Сочи», наставник «Спартака» своим поведением позорит весь российский футбол. «Считаю, Тедеско показал себя не в лучшем свете. Есть же видеозаписи, все зафиксировано. Он же тренер! В спорте важно в том числе и уметь проигрывать. Такое поведение недопустимо! Может быть, это чистая показуха с его стороны для владельцев «Спартака»? Так хотел себя проявить? Но это позорит весь наш российский футбол! Послушайте, человек приехал сюда работать. Так будь достоин нашей страны, ее общества», — добавил Ротенберг. Наставник «красно-белых» повздорил с вратарем «Сочи» Сосланом Джанаевым после матча, а в перерыве встречи конфликтовал с тренером голкиперов сочинцев Дмитрием Бородиным. По словам Тедеско, Бородин позволил себе оскорбительные высказывания в его адрес с указанием на иную национальность специалиста. Кроме того, Тедеско заявил, что футболист «Сочи» ударил его помощника Андреаса Хинкеля. Российская премьер-лига (РПЛ) объявила о начале проверки по итогам матча. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/8/16/756078680099168.jpg', 'https://sportrbc.ru/news/5fd619b89a7947545aef53c2?from=newsfeed'),
(3104, 'Российские лыжники заняли весь пьедестал по итогам гонки на Кубке мира', 'Российский лыжник Александр Большунов выиграл гонку с раздельным стартом свободным стилем на 15 км на втором этапе Кубка мира в Давосе (Швейцария). Он прошел дистанцию за 32 минуты 46,4 секунды. Вторым стал россиянин Андрей Мельниченко (33 минуты 18,6 секунды), третье место занял Артем Мальцев (33.25,9). На четвертой позиции финишировал Иван Якимушкин. В десятку также попали российские лыжники Денис Спицов и Алексей Червоткин. Соревнования проходили без участия спортсменов из сборных Норвегии, Финляндии и Швеции, которые приняли решение сняться с декабрьских этапов Кубка мира из-за риска заражения коронавирусом. Выиграв Кубок мира в минувшем сезоне, Большунов стал первым лыжником в истории России, завоевавшим «Большой хрустальный глобус». Ранее победителями лыжного сезона также становились Александр Завьялов и Владимир Смирнов, выступавшие за сборную СССР. 23-летний спортсмен также является трехкратным серебряным призером Олимпийских игр и четырехкратным серебряным призером чемпионатов мира.   ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/1180xH/media/img/9/90/756078674082909.jpg', 'https://sportrbc.ru/news/5fd61a889a794753e9c6813a?from=newsfeed'),
(3127, 'Разработчик вакцины AstraZeneca оценила комбинацию со «Спутником V»', 'Разработанная Оксфордским университетом совместно с британско-шведской фармацевтической компанией AstraZeneca вакцина против коронавируса COVID-19 может быть более эффективна в комбинации с другими препаратами, в том числе с российской вакциной «Спутник V». Об этом в «Шоу Эндрю Марра», которое выходит на Би-би-си, заявила профессор Оксфордского университета Сара Гилберт, руководившая работой по созданию вакцины. Отвечая на вопрос, будет ли британская вакцина высокоэффективна в сочетании с другими вакцинами, включая российскую, Гилберт сказала: «Да, безусловно, такая возможность есть. Мы уделяли внимание этому вопросу ранее, проводя посвященные вакцинам исследования». По ее словам, эффект от связки вакцины AstraZeneca с другим однородным препаратом будет изучен в ходе сравнительно «небольшого исследования». Гилберт отметила, что не видит проблем в том, что вакцина «Спутник V» пока не зарегистрирована нигде, кроме России. Материал дополняется. ', NULL, '', 'https://www.rbc.ru/society/13/12/2020/5fd633e89a794759b4721b41?from=newsfeed'),
(3138, 'В Чечне за сутки зафиксировали шесть землетрясений', 'В Чечне произошло землетрясение магнитудой 2,9. Это уже шестое сейсмособытие в регионе, зафиксированное 13 декабря. Об этом сообщает агентство ТАСС со ссылкой на пресс-службу регионального МЧС. «Стоит отметить, что вся территория Северного Кавказа подвержена землетрясениям. Незначительные сейсмособытия случаются по всему миру каждый день. Они не несут никаких последствий», — сообщил представитель ведомства. Он также отметил, что точно предугадать время и места землетрясения невозможно. Первые подземные толчки магнитудой 5,6 были зафиксированы в 00:30 мск в Урус-Мартановском районе Чечни на глубине 25 км. Следующее землетрясение произошло в 12:15 мск магнитудой 3,7 в 45 км юго-восточнее Грозного. Позднее подземные толчки также были зарегистрированы в 14:40 магнитудой 4,1, в 15:08 магнитудой 3,1, а также в 16:05 магнитудой 3,8. В пресс-службе МЧС подчеркнули, что никаких сообщений о пострадавших или каких-либо последствиях от землетрясения в ведомство не поступало. 10 декабря землетрясение произошло недалеко от Иркутска. В городе оно ощущалось на 5-6 баллов, однако в эпицентре интенсивность толчков достигла 7,6 баллов. Информации о пострадавших и разрушениях также не поступало, однако позднее заммэра Иркутска Виталий Барышников рассказал, после землетрясения в 18 школах города и нескольких детских садах обнаружили трещины. ', NULL, 'https://s0.rbk.ru/v6_top_pics/resized/500x312_crop/media/img/9/14/756075820849149.jpg', 'https://www.rbc.ru/rbcfreenews/5fd639e29a794759c8506b4d?from=newsfeed');
